    (1, 37.5599277853801, 126.975359779271, '서울 숭례문 (서울 崇禮門)', '문화재', 'thumbnail_url', '서울 중구 세종대로 40 (남대문로4가)', '유적건조물 / 정치국방 / 성 / 성곽시설', '조선시대 한양도성의 정문으로 남쪽에 있다고 해서 남대문이라고도 불렀다...', NULL, NULL, NULL, NULL, '1962-12-20', '조선 태조 7년(1398)', 'atlas_image_url', '8730e1d8cffffff', '8830e1d8c5fffff', '8930e1d8c4bffff', '8a30e1d8c487fff', '8b30e1d8c484fff', '8c30e1d8c4841ff', '2024-04-25', '2024-04-25'),
