    (3, 37.5427691121748, 126.966031112156, 'KLO첩보대 훈련교육대 터', '6·25전쟁', 'thumbnail_url', '서울 용산구 청파동3가 131 선린인터넷정보고등학교', '국가수호사적지', '선린상고(현 선린인터넷정보고등학교) 자리는 6·25전쟁 당시 미군 산하에서 활동하던 KLO첩보대의 고트대, 위스키대 등의 훈련소였다...', '멸실', '6·25전쟁 기간 북한지역 정보수집을 위한 침투한 KLO 첩보대를 교육 훈련시킨 훈련교육대가 있었던 곳', '서울특별시 용산구 청파동3가 131', '이영순,「 KLO/8240부대 전기」,『 세대』5권 3호, 1967, 3, 205-213쪽.', NULL, NULL, 'atlas_image_url', '8730e1d83ffffff', '8830e1d833fffff', '8930e1d8323ffff', '8a30e1d83227fff', '8b30e1d83223fff', '8c30e1d832235ff', '2024-04-25', '2024-04-25'),
    (4, 37.5387252714359, 127.125141751389, '에덴모자원 터', '6·25전쟁', 'thumbnail_url', '서울 강동구 천호동 454-1', '국가수호사적지', '6·25전쟁 기간 전사자가 속출하면서 자연 많은 전쟁미망인과 고아가 발생하였다. 전쟁기간 유엔과 지원국가들로부터 지원을 받아 이들을 구호하였지만...', '멸실', '전쟁미망인들의 자활시설인 에덴모자원이 있던 곳', '경기도 광주군 구천면 성내리 57', '『서울신문』, 1952년 4월 30일,「 사회부, 미망인 통계 발표」.', NULL, NULL, 'atlas_image_url', '8730e1cf4ffffff', '8830e1cf4bfffff', '8930e1cf4a3ffff', '8a30e1cf4a27fff', '8b30e1cf4a26fff', '8c30e1cf4a263ff', '2024-04-25', '2024-04-25'),
    (5, 37.5808043433810, 126.986924045177, '3·1운동 단일화 합의 장소', '3·1운동', 'thumbnail_url', '서울 종로구 계동 130-1', '국내항일운동 사적지', '1919년 2월 초순 재동 최린의 집과 계동 김사용의 집(김성수의 숙소)에 중앙고보 숙직실에 모여 독립운동 거사를 모의하기 시작한 최린·송진우·현상윤·최남선은 독립선언서에 서명할 민족대표로 처음에 박영효·윤용구·한규설·김윤식 등 대한제국 시절 요직에 있었던 명망가들을 추대하기로 하였다...', '멸실', '기독교계 지도자 이승훈이 송진우를 만나 천도교 측의 거사 제의를 받고 독립운동(3·1운동)의 일원화 문제를 처음 논의한 곳', '경성부 계동 130', '독립운동사편찬위원회, 『독립운동사자료집』5, 1972, 16∼17, 81∼82쪽.', NULL, NULL, 'atlas_image_url', '8730e1dabffffff', '8830e1dab7fffff', '8930e1dab6fffff', '8a30e1dab6f7fff', '8b30e1dab6f0fff', '8c30e1dab6f07ff', '2024-04-25', '2024-04-25'),
    (6, 37.5625131235612, 126.979717419003, '선은전광장 3·1운동 만세시위지', '3·1운동', 'thumbnail_url', '서울 중구 남대문로3가 110', '국내항일운동 사적지', '1919년 3월 1일 탑골공원에서 독립선언식을 거행한 뒤, 오후 3시경 고종 황제의 빈전이 마련된 덕수궁 대한문 앞에 모여 독립만세를 부르고 연설을 한 시위대의 일단은 만세를 부르며 장곡천정(長谷川町, 현 소공로)을 거쳐 남산 조선총독부를 향해 행진하였다...', '부분변형', '1919년 3월 1일 독립만세를 부르며 남산 조선총독부를 향해 행진하던 수천 명의 시위대가 모여 독립만세시위를 벌인 곳', '경성부 남대문통3정목 110', '「홍일창 등 3인 판결문」, 1920년 10월 26일, 국가보훈처 공훈전자사료관.', NULL, NULL, 'atlas_image_url', '8730e1d8cffffff', '8830e1d8c5fffff', '8930e1d8c47ffff', '8a30e1d8c45ffff', '8b30e1d8c45bfff', '8c30e1d8c45b9ff', '2024-04-25', '2024-04-25');
